import { forwardRef } from "react"
import mosquito from '../../pics/mosq.png';

const MosquitoRoulette = (props, ref) => {
    const displayMosquitos = () => {
		const radius = 500;
		const step = (2 * Math.PI) / 7;
		const list = [];
		let angle = 0;
		for (let i = 1; i <= 7; i++) {
			list.push(
				<img
					key={i}
					className='w-1/5 absolute'
					style={{
						top: Math.round(
							ref.current.clientHeight / 2 + radius * Math.sin(angle) - 15
						),
						left:
							Math.round(ref.current.clientWidth / 2 + radius * Math.cos(angle)) -
							100,
					}}
					src={mosquito}
					alt='Mosquito'
				/>
			);
			angle += step;
		}

		return list;
	};

    return (
        <div>
            {displayMosquitos()}
        </div>
    )
}

export default forwardRef(MosquitoRoulette)
